import {leontoolsApi} from "./apiCall";
import axios from "axios";

function checkUserFromDb(googleId) {
    axios.get(leontoolsApi+"users/check/"+googleId)
        .then((response) => {
            return response
        }).catch((e) => {
            return e
    })
}

export default checkUserFromDb;
